export default function MyHeader() {

  return (
     <div className="header">
        <div className="title-wrapper">
            <svg className="logo-icon" viewBox="0 0 100 100">
                <circle cx="50" cy="5" r="5" fill="white" opacity="0.2"/>
                <text x="50.2%" y="5.8%" text-anchor="middle" fill="#fff" font-size="8" font-weight="bold" dy=".3em">B</text>
            </svg>

            <div className="header-title">Billing App</div>
        </div>

        <div className="header-right">
            Modern UI
        </div>
    </div>
  );
}
